import React from "react";
import Quiz from 'react-quiz-component';
import {quiz} from './Quiz.js';
import './Quizes.css';
 function Quizes(){
    

    return (
    <div>
    <Quiz quiz={quiz} showDefaultResult={false}/>
    
    <h1>SOME Quiz</h1>;
    </div>
    );
 };
 export default Quizes;
